import { css } from "@emotion/react";
import { Heading, VFlow } from "bold-ui";
import React from "react";
import { AccordionFinalSummary } from "../components/AccordionFinalSummary";
import { numAccordions } from "./DeskView";

interface FinalSummaryProps {
  numDesks: number;
}

export function FinalSummary(props: FinalSummaryProps) {
  const { numAccordions } = props;
  return (
    <VFlow vSpacing={1}>
      <Heading color="normal" level={1}>
        Resumo de pedidos
      </Heading>
      <numDesks></numDesks>
      <AccordionFinalSummary></AccordionFinalSummary>
    </VFlow>
  );
}

const Styles = css`
  width: 100%;
`;
